import React from 'react'

const Course = ({ course }) => {
    console.log(course)
    return (
        <div>
            <Header />
            <Content />
            <Total />
        </div>
    )

    const Header = () => {
        return (
            <h2></h2>
        )
    }

    const Content = () => {
        return (
            <Part />
        )
    }
    const Part = () => {
        return (
            <p></p>
        )
    }
    const Total = () => {
        return (
            <stron></stron>
        )
    }
}

export default Course
